function LoginPage() {
  return (
    <div className="formular">
      <form action="">
        <div className="input-box">
          <input type="email" placeholder="E-Mail" required />
        </div>
        <div className="input-box">
          <input type="password" placeholder="Passwort" required />
        </div>
        <input type="submit" value="Absenden" />
      </form>
      <p id="output"></p>
    </div>
  );
}

export default LoginPage;
